import './App.css';
import { Route, BrowserRouter, Switch} from "react-router-dom"; 
import routes from './config/routes';
import { isRegistered } from './utils/cookie';

const CobaRoute = () => {
  if (isRegistered()) {
    window.location.replace('/register');
  } else {
    window.location.replace('/');
  }
}

const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        {routes.map((route) => {
            return (
              <CobaRoute
                path={route.path} 
                exact component={route.component} 
                key={route.path}
              />
            )
        })}
      </Switch>
    </BrowserRouter>
  );
}

export default App;
